import React from "react";
import Button from "./Button.jsx";
import RouteButton from "./RouteButton.jsx"

export default class CreateAccountPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      email: "",
      password: "",
      confirmPass: "",
      ubit: "",
